import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useWallet } from '../utils/WalletContext';
import XfiStaking from '../components/XfiStaking';
import Analytics from '../components/Analytics';
import RewardsSystem from '../components/RewardsSystem';
import DefiIntegration from '../components/DefiIntegration';

const Dashboard = () => {
  const [requests, setRequests] = useState([]);
  const [xfiBalance, setXfiBalance] = useState('0');
  const [xfiPrice, setXfiPrice] = useState('0');
  const { account, provider } = useWallet();

  useEffect(() => {
    if (account && provider) {
      fetchRequests();
      fetchXfiBalance();
      fetchXfiPrice();
    }
  }, [account, provider]);

  const fetchRequests = async () => {
    try {
      const response = await axios.get(`http://localhost:5000/api/user/transactions/${account}`);
      setRequests(response.data);
    } catch (error) {
      console.error('Error fetching user requests:', error);
    }
  };

  const fetchXfiBalance = async () => {
    try {
      const xfiTokenABI = ['function balanceOf(address) view returns (uint256)']; 
      const xfiToken = new ethers.Contract(XFI_TOKEN_ADDRESS, xfiTokenABI, provider);
      const balance = await xfiToken.balanceOf(account);
      setXfiBalance(ethers.utils.formatEther(balance));
    } catch (error) {
      console.error('Error fetching XFI balance:', error);
    }
  };

  const fetchXfiPrice = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/xfi/price');
      setXfiPrice(response.data.price);
    } catch (error) {
      console.error('Error fetching XFI price:', error);
    }
  };

  return (
    <div>
      <h2 className="text-2xl font-bold mb-4">Your XFI Dashboard</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-8">
        <div className="bg-white shadow-md rounded px-8 pt-6 pb-8">
          <h3 className="text-xl font-bold mb-2">XFI Balance</h3>
          <p className="text-2xl">{xfiBalance} XFI</p>
          <p>Current XFI Price: ${xfiPrice}</p>
        </div>
        <XfiStaking />
      </div>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-8">
        <RewardsSystem />
        <DefiIntegration />
      </div>
      <Analytics />
      <h3 className="text-xl font-bold mt-8 mb-4">Your XFI Transactions</h3>
      <table className="w-full border-collapse">
        <thead>
          <tr className="bg-gray-200">
            <th className="border p-2">Transaction Hash</th>
            <th className="border p-2">Amount (XFI)</th>
            <th className="border p-2">Type</th>
            <th className="border p-2">Status</th>
          </tr>
        </thead>
        <tbody>
          {requests.map((tx) => (
            <tr key={tx.tx_hash}>
              <td className="border p-2">{tx.tx_hash}</td>
              <td className="border p-2">{ethers.utils.formatEther(tx.value)} XFI</td>
              <td className="border p-2">{tx.from_address === account ? 'Sent' : 'Received'}</td>
              <td className="border p-2">{tx.successful ? 'Successful' : 'Failed'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;
